            if n % i == 0:
                return False
        return True
    prime_numbers = [num for num in range(start, end + 1) if is_prime(num)]
    prime_numbers = prime_numbers[:5]
    table = [[i * j for j in prime_numbers] for i in prime_numbers]
    return table

